// componentsapp/Navigation.js

import React from 'react';
import { Link } from 'react-router-dom';

const Navigation = () => (
    <nav>
        <ul>
            <li><Link to="/">Etusivu</Link></li>
            <li><Link to="/Build">Rakennussivu</Link></li>
        </ul>
    </nav>
);

export default Navigation;
